        }
    }

    handleSubmit = e => {
        event.preventDefault();

        this.setState({
            email:'',
            password:''})
    }

    render(){
        return(
            <div className='sign-in'>

                <h2>I have an account</h2>
                <span>Sign in with your email and password</span>

                <form onSubmit={this.handleSubmit}>
                    <intput name='email' type='email' value={this.state.email} required />
                    <label>Email</label>

                    <intput name='password' on type='password' value={this.state.password} required />
                    <label>Password</label>

                    <input type='submit' value='Submit Form' />
                </form>

            </div>


        )
    }
}


